// Signin.js
import React from "react";
import "./Signin.css";
import Button from "react-bootstrap/Button";
import Container from "react-bootstrap/Container";
import Form from "react-bootstrap/Form";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";

import "bootstrap-icons/font/bootstrap-icons.css";

function Signin() {
  return (
    <div className="signin-bg">
      <Navbar expand="xxl" className="home-navbar">
        <Container fluid>
          <Navbar.Brand
            href="#"
            className="home-text-white"
            style={{ fontSize: "30px", fontWeight: "500" }}
          >
            <i class="bi bi-chat-right-quote-fill"></i>
            &nbsp;&nbsp;Vibe Connect
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="navbarScroll" />
          <Navbar.Collapse id="navbarScroll">
            <Nav
              className="me-auto my-2 my-lg-0 "
              style={{ maxHeight: "100px" }}
              navbarScroll
            >
              <Nav.Link href="#action1" className="home-text-white">
                Home
              </Nav.Link>
              <Nav.Link href="#action2" className="home-text-white">
                Link
              </Nav.Link>
            </Nav>
            <Form className="d-flex home-btn">
              <Button variant="outline-danger" className="home-text-white">
                Sign in
              </Button>
              &nbsp;&nbsp;
              <Button variant="outline-success" className="home-text-white">
                Sign up
              </Button>
            </Form>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
}

export default Signin;
